import './App.css';
import DisplayHeader from './components/atm-header';
import DisplayScreen from './components/atm-screen';
import { ThemeProvider, createTheme, Box, Grid2 } from '@mui/material';
import { styled } from '@mui/material/styles';
import Button from '@mui/material/Button';

import { makeStyles } from 'tss-react/mui';

const MyButton = styled(Button)`
background-color: blue;
color: white;
&:hover {
  background-color: darkblue;
}
`;

const theme = createTheme({
  components: {
    MuiContainer: {
      defaultProps: {
        backgroundColor: 'red',
        height: 'lg',
        width: 'lg', // or 'md', 'sm', 'xl'
      },
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Grid2 container spacing={2}>
        <Grid2 size={8}>
          <Grid2 item><MyButton>Click me</MyButton></Grid2>
        </Grid2>
        <Grid2 size={8}>
          <Grid2 item>size=8</Grid2>
        </Grid2>
        <Grid2 size={8}>
          <Grid2 item>size=8</Grid2>
        </Grid2>
      </Grid2>
    </ThemeProvider>
  );
}

